import React, {Component} from 'react';
import Navbar from './Navbar';
import './About.css';
import profile from '../media/profile.jpeg';

class About extends Component {
    render() {
        return (
            <div> 
                <Navbar page="about"/>
                <div className="aboutPage">
                    <h1 className="aboutHeader"> ABOUT ME 
                    </h1>
                    <div className="aboutBody">
                        <img className="dp" src={profile}/>
                        <div className="aboutText">
                            <p className="aboutParagraph">
                            I'm an undergrad at UC Berkeley studying Computer Science and Data Science with a concentration in Applied Mathematics.
                            </p>
                            <p className="aboutParagraph">
                            I'm a producer and amateur skier. I do table tennis @ Cal TTC, and I play the piano. I also build things.
                            </p>
                            <p className="aboutParagraph">
                            Next summer I'll be working at Apple in Cupertino, and next fall I'll be working at TikTok in Los Angeles.
                            </p>
                            <p className="aboutParagraph">
                            I'm currently building out CS 198-75 sponsored by Professor Josh Hug, working on CMS automation with 11ty, in addition to curriculum development with a team of TAs. I'll be lecturing in Evans 60 this coming Spring.
                            </p>
                        </div>
                    </div>
                </div>
            </div>
        );
    }
}

export default About;
